import React, { Component } from 'react';
import { Card, Switch, Tag, Input, Checkbox, Select } from 'antd';
import 'antd/dist/antd.css';

const { Search } = Input;

const { Option } = Select;

export class App extends Component {
  state = {
    denomination: false
  }

  onChange = (e) => {
    this.setState({denomination: e.target.checked});
  }

  onDispatch = (e) => {

  }

  handleChange = () => {

  }

  render() {
    return (
      <Card title="ATM Machine" style={{ width: 300, textAlign: "center", margin: "auto" }}>
        <p>Available Notes :</p>
        <Tag color="magenta">10</Tag>
        <Tag color="red">20</Tag>
        <Tag color="cyan">50</Tag>
        <br />
        <Tag color="blue">100</Tag>
        <Tag color="green">200</Tag>
        <Tag color="dark-yellow">500</Tag>
        <Tag color="purple">1000</Tag>

        <Checkbox onChange={this.onChange} style={{margin: "50px 0"}}>Denoimation</Checkbox>
        <Select defaultValue="100" style={{ width: 120 }} onChange={this.handleChange} size="small" disabled={!this.state.denomination}>
          <Option value="10">10</Option>
          <Option value="20">20</Option>
          <Option value="50">50</Option>
          <Option value="100">100</Option>
          <Option value="200">200</Option>
          <Option value="500">500</Option>
          <Option value="1000">1000</Option>

        </Select>

        <Search placeholder="Amount" allowClear enterButton="Dispatch" size="small" onSearch={this.onDispatch} />
      </Card>
    )
  }
}

export default App
